$color-green: #0DC860;

.zh-page{
  width: 1920px;
  header{
    position: relative;
    display: flex;
    justify-content: space-between;
    height: 90px;
    background: #1f2535;

    .header-l{
      display: flex;
    }

    .logo{
      width: 238px;
      height: 90px;
    }
    .user-bar{
      li{
        display: inline-block;
        text-align: center;
        width: 74px;
        color: $color-blue;
        height: 90px;
        line-height: 90px;

        a{
          color: $color-blue;

          &:hover{
            color: rgba($color-blue, 0.7)
          }
        }

        .icon{
          display: inline-block;
          vertical-align: middle;
          background-size: cover;
          background-repeat: no-repeat;
          width: 16px;
          height: 16px;
          margin-right: 5px;
        }

        .icon-my{
          background-image: url("images/icon/my.png");
        }
        .icon-logout{
          background-image: url("images/icon/logout.png");
        }
      }

    }
  }
  nav{
    flex: 1;
    .menu-item{
      display: inline-block;
      width: 200px;
      text-align: center;
      color: $color-blue;
      height: 90px;
      line-height: 90px;

      .icon{
        width: 20px;
        height: 20px;
        display: inline-block;
        margin-right: 5px;
        background-repeat: no-repeat;
        background-size: cover;
        vertical-align: middle;
      }

      .icon-home{ background-image: url("images/icon/nav-home.png"); }
      .icon-resource{ background-image: url("images/icon/nav-resource.png"); }
      .icon-maintain{ background-image: url("images/icon/nav-maintain.png"); }
      .icon-ci{ background-image: url("images/icon/nav-ci.png"); }
      .icon-check{ background-image: url("images/icon/nav-check.png"); }
      .icon-setting{ background-image: url("images/icon/nav-setting.png"); }

      .menu-item-name{
        display: block;
        height: 90px;
        position: relative;
      }

      &:hover{
        background: #1a161c;

        .icon-home{ background-image: url("images/icon/nav-home_hover.png"); }
        .icon-resource{ background-image: url("images/icon/nav-resource_hover.png"); }
        .icon-maintain{ background-image: url("images/icon/nav-maintain_hover.png"); }
        .icon-ci{ background-image: url("images/icon/nav-ci_hover.png"); }
        .icon-check{ background-image: url("images/icon/nav-check_hover.png"); }
        .icon-setting{ background-image: url("images/icon/nav-setting_hover.png"); }

        .menu-item-container{
          display: block;
        }

        &.has-submenu{
          .menu-item-name:before{
            display: block;
            width: 0;
            height: 0;
            content: '';
            border-style: solid;
            border-color: transparent transparent #fff transparent;
            border-width: 0 9px 9px 9px;
            position: absolute;
            bottom: 0;
            left: 50%;
            margin-left: -9px;
          }
        }
      }
    }
    .menu-item-container{
      display: none;
      width: 100%;
      position: absolute;
      background: #ffffff;
      box-shadow: 0px 6px 20px 0px rgba(202, 202, 202, 0.71);
      z-index: 9;
      left: 0;

      section{
        padding: 30px 0;
        width: 960px;
        margin: 0 auto;
        text-align: left;

        dl{
          display: inline-block;
          vertical-align: top;
          width: 120px;
          text-align: left;
          margin-right: 80px;
        }
        dt, dd{
          box-sizing: content-box;
        }
        dt{
          font-size: 18px;
          height: 18px;
          line-height: 18px;
          padding: 20px 0;
          border-bottom: 1px solid $color-blue;
          margin-bottom: 10px;

          a{
            color: $color-blue;
          }
        }
        dd{
          font-size: 14px;
          padding: 5px 0;
          line-height: 24px;
          height: 24px;

          a{
            color: #1F2535;

            &:hover{
              color: $color-blue;
            }
          }
        }
      }
    }
  }
}

.zh-panel{
  background: #FFFFFF;
  box-shadow: 3px 5px 4px 0 rgba(2, 59, 115, 0.1);
  border-radius: 10px;
  padding: 20px 30px;
  margin-bottom: 30px;

  .subhead{
    display: inline-block;
    height: 24px;
    line-height: 24px;
    vertical-align: middle;
    font-size: 16px;
    color: #1F2535;
  }
}
.zh-panel-header{
  height: 24px;
  line-height: 24px;
  margin-left: -30px;
  margin-right: -30px;
  font-size: 24px;
  font-weight: 400;
  text-indent: 30px;
  color: #1A161C;
  text-overflow: ellipsis;
  white-space: nowrap;
  overflow: hidden;
  border-left: 4px solid $color-blue;
  margin-bottom: 30px;

  .subhead{
    margin-left: 20px;
  }

}

.zh-page-container{
  background: #F1F5F8;
  .board-container{
    margin-bottom: 30px;
    .board-header{
      font-size: 24px;
      color: #1A161C;
      padding: 5px 0;
      line-height: 44px;
    }
    .board-body{

    }
    .board-panel{

    }
    .board-item1, .board-item2{
      flex: 1;
      height: 118px;
      background: #FFFFFF;
      box-shadow: 3px 5px 4px 0 rgba(2, 59, 115, 0.1);
      border-radius: 10px;
      padding: 20px;
    }
    .board-item1{
      position: relative;
      .title{
        font-size: 18px;
        color: #1F2535;
        height: 20px;
        line-height: 20px;
        margin-bottom: 5px;
      }
      .num{
        display: inline-block;
        font-size: 48px;
        color: $color-blue;
      }
      .icon{
        position: absolute;
        background-size: cover;
        background-repeat: no-repeat;
        width: 60px;
        height: 60px;
        display: inline-block;
        top: 20px;
        right: 20px;

        &.icon-host01{background-image: url("images/icon/host01.png");}
        &.icon-host02{background-image: url("images/icon/host02.png");}
        &.icon-host03{background-image: url("images/icon/host03.png");}
        &.icon-host04{background-image: url("images/icon/vhost@2x.png");}
        &.icon-host05{background-image: url("images/icon/VM@2x.png");}
      }
    }
    .board-item1-body{
      display: flex;
      justify-content: flex-start;
      align-items: baseline;
    }
    .board-item1-text{
      display: inline-block;
      font-size: 16px;
      color: $color-blue;
    }
    .board-item2{
      dl{
        display: flex;
        justify-content: space-around;
      }
      dt, dd{
        display: inline-block;
        height: 100%;
      }
      dt{
        color: #1F2535;
        font-size: 20px;
        font-weight: normal;

        &:before{
          content: '';
          width: 10px;
          height: 10px;
          background: #37A1F7;
          border-radius: 50%;
          display: inline-block;
          margin-right: 5px;
        }
      }
      dd{
        flex: 1;
        border-left: 1px solid #E0E6EB;
        padding-left: 40px;
        &:first-of-type{
          border: none;
        }
        .num{
          font-size: 40px;
          line-height: 40px;
          margin-bottom: 15px;

          &.blue{
            color: $color-blue;
          }
          &.orange{
            color: $color-orange;
          }
          &.green{
            color: $color-green;
          }
        }
        .text{
          font-size: 16px;
          color: #666666;
        }
      }
    }
  }
  .main-dash-1, .main-dash-2{
    ul{
      display: flex;
      justify-content: space-around;
      margin-left: -15px;
    }
    li{
      margin-left: 15px;
    }
  }
  .main-dash-1{
    margin-bottom: 15px;
  }
  /**
   * 左边主界面
   */
  .main-left{
    margin-right: -15px;
    padding: 15px;
    padding-right: 0;
  }
  .zh-panel_storage{
    height: 304px;
  }
  /**
   * 轮播图
   */
  .carousel-container{
    .carousel-item{
      display: flex;
      justify-content: space-between;
    }
    .computer{
      width: 48%;
      dl{
        margin: 10px;
        display: flex;

        dt, dd{
          text-overflow: ellipsis;
          white-space: nowrap;
          overflow: hidden;
          font-size: 16px;
          height: 34px;
          line-height: 34px;
        }

        dt{
          width: 40%;
          color: #ffffff;
          text-align: right;
          background: #9CB8CF;

          &.blue{
            background: $color-blue;
          }
          &.orange{
            background: $color-orange;
          }
          &.green{
            background: $color-green;
          }
        }
        dd{
          flex: 1;
          background: #F1F5F8;
          padding: 0 10px;
        }
      }
    }
  }
  /**
   * 轮播图默认样式更改
   */
  .owl-nav{
    position: absolute;
    top: 40%;
    width: 100%;
    display: flex;
    justify-content: space-between;
    outline: none;
  }
  .owl-prev, .owl-next{
    width: 34px;
    height: 55px;
    outline: none;
    background:transparent;
    background-size: 100% 100%!important;
    background-repeat: no-repeat;
    position: absolute;

    span{
      display: none;
    }
  }
  .owl-prev{
    background-image: url("images/icon/left@2x.png")!important;
    left: -34px;

    &:hover{
      background-image: url("images/icon/left_hover@2x.png")!important;
    }
  }
  .owl-next{
    background-image: url("images/icon/right@2x.png")!important;
    right: -34px;

    &:hover{
      background-image: url("images/icon/right_hover@2x.png")!important;
    }
  }
  .owl-dots{
    text-align: center;
  }
  .owl-dot{
    width: 6px;
    height: 6px;
    display: inline-block;
    background: #E0E6EB!important;
    border-radius: 3px;
    overflow: hidden;
    margin: 0 4px;
    outline: none;
    &:focus{
      border: none;
    }
    &.active{
      width: 24px;
      background: $color-blue!important;
    }
  }
  .network-panel-1{
    padding: 20px 0;
    background: #F1F5F8;
    border-radius: 6px;
    margin-bottom: 10px;

    ul{
      display: flex;
      justify-content: space-around;
    }

    li{
      width: 33.3333333%;
      border-left: 1px solid #E0E6EB;
      text-align: center;
      box-sizing: border-box;
      overflow: hidden;

      &:first-child{
        border: none;
      }
    }

    .num, .text{
      text-align: center;
      text-overflow: ellipsis;
      white-space: nowrap;
      overflow: hidden;
    }

    .num{
      font-size: 24px;
      line-height: 24px;
      margin-bottom: 10px;

      &.blue{
        color: $color-blue;
      }
      &.orange{
        color: $color-orange;
      }
      &.green{
        color: $color-green;
      }
    }
    .text{
      font-size: 14px;
      line-height: 14px;
      height: 14px;
      color: #666666;
    }
  }
  .network-panel-2{
    border-radius: 6px;
    overflow: hidden;
    .header{
      height: 40px;
      line-height: 40px;
      background: #9CB8CF;
      font-size: 14px;
      color: #FFFFFF;
      text-align: center;
    }
    .body{
      background: #F1F5F8;
      ul{
        padding: 5px 20px 0;
      }
      li{
        border-bottom: 1px solid #E0E6EB;
        display: flex;
        height: 34px;
        line-height: 34px;
        &:last-child{
          border: none;
        }

        .li-label, .li-value{
          text-align: right;
          text-overflow: ellipsis;
          white-space: nowrap;
          overflow: hidden;
        }

        .li-label{
          width: 40%;
        }
        .li-value{
          flex: 1;

          b{
            font-size: 18px;
            color: $color-blue;
            font-weight: normal;
          }
        }
      }
    }
  }
  .os-info{
    margin-left: -15px;
    margin-right: -15px;
  }
  .os-info-1, .os-info-2, .os-info-3{
    box-sizing: content-box;
    background: #F1F5F8;
    border-radius: 6px;
    text-overflow: ellipsis;
    white-space: nowrap;
    overflow: hidden;
  }
  .os-info-1{
    height: 24px;
    line-height: 24px;
    text-align: center;
    font-size: 14px;
    font-weight: 400;
    color: #1F2535;
    padding: 30px 0;
    margin-bottom: 10px;

    b{
      font-weight: normal;
      color: #FF552D;
      font-size: 24px;
    }
  }
  .os-info-2{
    padding: 20px;
    margin-bottom: 10px;
    ul{
      display: flex;
      justify-content: space-around;
    }

    li{
      width: 40%;
      border-left: 1px solid #E0E6EB;
      text-align: center;
      box-sizing: border-box;
      overflow: hidden;

      &:first-child{
        width: 60%;
        border: none;
      }
    }

    .num, .text{
      text-align: center;
      text-overflow: ellipsis;
      white-space: nowrap;
      overflow: hidden;
    }

    .num{
      font-size: 24px;
      line-height: 24px;
      margin-bottom: 10px;

      &.blue{
        color: $color-blue;
      }
      &.orange{
        color: $color-orange;
      }
      &.green{
        color: $color-green;
      }
    }
    .text{
      font-size: 14px;
      line-height: 14px;
      height: 14px;
      color: #666666;
    }
  }
  .os-info-3{
    ul{
      padding: 5px 20px 0;
    }
    li{
      border-bottom: 1px solid #E0E6EB;
      display: flex;
      height: 34px;
      line-height: 34px;
      &:last-child{
        border: none;
      }

      .li-label, .li-value{
        text-align: right;
        text-overflow: ellipsis;
        white-space: nowrap;
        overflow: hidden;
      }

      .li-label{
        width: 50%;
      }
      .li-value{
        flex: 1;

        b{
          font-size: 18px;
          color: $color-blue;
          font-weight: normal;
        }
      }
    }
  }

  /**
   * 右侧边栏
   */
  .side-right{
    padding-top: 15px;
    padding-right: 15px;
  }
  .side-title{
    font-size: 24px;
    color: #1A161C;
    padding: 5px 0;
    line-height: 44px;
  }
  // 右侧菜单容器
  .side-menu-container{
    ul{
      margin-left: -4%;
      margin-bottom: -30px;
      font-size: 0;
    }
    li{
      display: inline-block;
      width: 46%;
      margin-left: 4%;
      text-align: center;
      background: #FFFFFF;
      border: 1px solid $color-blue;
      border-radius: 6px;
      height: 50px;
      line-height: 50px;
      margin-bottom: 30px;
      overflow: hidden;
    }
    a{
      display: block;
      font-size: 16px;
      color: $color-blue;

      &:hover{
        background: $color-blue;
        color: #fff;
      }
    }
  }
  // 数据bar容器
  .data-bar-container{
    dl{
      display: flex;
      justify-content: space-around;
      align-items: center;
      height: 20px;
      line-height: 20px;
      padding: 10px 0;
      dt{
        width: 60px;
        padding-right: 10px;
        font-size: 14px;
        color: #666666;
        text-overflow: ellipsis;
        white-space: nowrap;
        overflow: hidden;
      }
      dd{
        flex: 1;
        display: flex;
        align-items: center;

        .progress-bar{
          flex: 1;
          height: 8px;
          background: #E0E6EB;
          border-radius: 4px;
          border: none;
          overflow: hidden;
          box-shadow: none;
        }
        .progress-fill{
          height: 100%;
          background: #6AB9F9;
        }
        .progress-label{
          width: 50px;
          padding-left: 10px;
          font-size: 14px;
          color: $color-blue;
        }
      }
    }
  }
  .product-list{
    ul{
      margin-bottom: -15px;
    }
    li{
      padding: 20px 15px;
      line-height: 34px;
      height: 34px;
      display: flex;
      justify-content: space-between;
      align-items: center;
      margin-bottom: 15px;
      background: #F1F5F8;
      border-radius: 6px;
      box-sizing: content-box;

      .label, .data{
        text-overflow: ellipsis;
        white-space: nowrap;
        overflow: hidden;
      }

      .label{
        font-size: 14px;
        color: #666666;
      }
      .data{
        font-size: 20px;
        color: $color-blue;
        text-align: right;;
      }
    }
  }
}

#storage{
  width: 100%;
  height: 200px;
}
